"serviceWorker"in navigator&&window.addEventListener("load",()=>{navigator.serviceWorker.register("/sw.js").then(e=>e.update()).catch(e=>{console.log("Registration failed with "+e)})});let images=document.querySelectorAll("article img:nth-child(2)");function addImage(e){e.classList.add("loaded")}for(img of images)setTimeout(addImage(img),5e3);